import Card from '../Card/Card';
import style from "./Cards.module.css"

const Cards = () => {

  const perros = useSelector()

   return (
    <div className={style.cards}>
      {perros.map((perro)=>{
        return (
        <Card
        image={perro.image}
        Nombre={perro.name}
        Temperamento={perro.temperament}
        Peso={perro.weight}
        />)
      })}        
    </div>
)}


export default Cards;
